import React from "react";
import { useState } from "react";
import Portfolio from "../portfolio_categories";

const GalleryReact = () => {

    const [items, setItems] = useState(Portfolio);
    return (
        <>
        <p>Our Latest Featured Projects</p>

        <div className="menu-tabs container">
            <div className="menu-tab d-flex justify-content-around">
                <button className="btn btn-warning">PHP</button>
                <button className="btn btn-warning">React</button>
                <button className="btn btn-warning">Wordpress</button>
                <button className="btn btn-warning">Drupal</button>
                <button className="btn btn-warning">ExpressionEngine</button>

            </div>
        </div>

        <div className="">
            <div className="row">
                <div className="col-11 mx-auto">
                    <div className="row">
                        {
                            items.map((elem) => {
                                const {id, name, image, description} = elem;

                                return (
                                    <div className="item1 col-12 col-md-6 col-lg-6 col-xl-4 ">
                                    <div className="row Item-inside">
                                        <div className="col-12 col-md-12 col-lg-4 col-xl-4 img-div ">
                                            <img src={image} alt="menupic" className="img-fluid" />
                                        </div>
                                        {/* menu desc */}
                                        <div className="col-12 col-md-12 col-lg-8">
                                           <div className="main-title pt-4 pt-3">
                                            <h1>magii</h1>
                                           </div>
                                
                                        </div>
                                    </div>
                                </div>
                                )

                            })
                        }

                   
                       

                        

                    </div>
                </div>

            </div>
        </div>
        </>
        
      )
}


export default GalleryReact;
